function UpcomingForecast({ upcomingDetails }) {
  return (
    <div className="upcoming__container">
        {upcomingDetails.map(detail => {
            return (
            <div className="upcoming__details">
                <ol>
                    <li>{detail.day}</li>
                    <li>{detail.icon}</li>
                    <li>{detail.temp}</li>
                </ol>
            </div>
            )

        })}
    </div>
  )
}

export default UpcomingForecast
